"use strict";(self.webpackChunkprogrammer_zaman_now=self.webpackChunkprogrammer_zaman_now||[]).push([[5826],{1950:function(a){a.exports=JSON.parse('{"pluginId":"pemrograman-java","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Pendahuluan","href":"/pemrograman/java/intro","docId":"intro"},{"type":"category","label":"Java Dasar","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Pengenalan Java","href":"/pemrograman/java/dasar/pengenalan-java","docId":"dasar/pengenalan-java"},{"type":"link","label":"Menginstall Java","href":"/pemrograman/java/dasar/menginstall-java","docId":"dasar/menginstall-java"},{"type":"link","label":"Integrated Development Environment","href":"/pemrograman/java/dasar/integrated-development-environment","docId":"dasar/integrated-development-environment"},{"type":"link","label":"Program Hello World","href":"/pemrograman/java/dasar/program-hello-world","docId":"dasar/program-hello-world"},{"type":"link","label":"Komentar","href":"/pemrograman/java/dasar/komentar","docId":"dasar/komentar"},{"type":"link","label":"Tipe Data Number","href":"/pemrograman/java/dasar/tipe-data-number","docId":"dasar/tipe-data-number"},{"type":"link","label":"Tipe Data Boolean","href":"/pemrograman/java/dasar/tipe-data-boolean","docId":"dasar/tipe-data-boolean"},{"type":"link","label":"Tipe Data Character","href":"/pemrograman/java/dasar/tipe-data-character","docId":"dasar/tipe-data-character"},{"type":"link","label":"Tipe Data String","href":"/pemrograman/java/dasar/tipe-data-string","docId":"dasar/tipe-data-string"},{"type":"link","label":"Variable","href":"/pemrograman/java/dasar/variable","docId":"dasar/variable"},{"type":"link","label":"Tipe Data Bukan Primitif","href":"/pemrograman/java/dasar/tipe-data-bukan-primitif","docId":"dasar/tipe-data-bukan-primitif"},{"type":"link","label":"Null","href":"/pemrograman/java/dasar/null","docId":"dasar/null"},{"type":"link","label":"Tipe Data Array","href":"/pemrograman/java/dasar/tipe-data-array","docId":"dasar/tipe-data-array"},{"type":"link","label":"Operator Matematika","href":"/pemrograman/java/dasar/operator-matematika","docId":"dasar/operator-matematika"}]}]},"docs":{"dasar/integrated-development-environment":{"id":"dasar/integrated-development-environment","title":"Integrated Development Environment","description":"Membuat Aplikasi Java sangat disarankan menggunakan IDE (Integrated Development Environment). IDE adalah sebuah code editor pintar yang lebih dari sekedar text editor. IDE memiliki kemampuan untuk melakukan code management, kompilasi kode program secara otomatis, sampai bisa digunakan untuk membuat distribution file dari kode program Java yang kita buat.","sidebar":"tutorialSidebar"},"dasar/komentar":{"id":"dasar/komentar","title":"Komentar","description":"Setiap bahasa pemrograman pasti memiliki fitur yang namanya komentar. Komentar adalah kode program yang tidak akan dieksekusi ketika dijalankan. Biasanya komentar digunakan untuk memberi informasi tambahan pada kode program kita agar mudah dimengerti.","sidebar":"tutorialSidebar"},"dasar/menginstall-java":{"id":"dasar/menginstall-java","title":"Menginstall Java","description":"Sebelum belajar pemrograman Java, kita perlu menginstall compiler dan runtime untuk Java nya terlebih dahulu. Dimana terdapat dua jenis aplikasi Java","sidebar":"tutorialSidebar"},"dasar/null":{"id":"dasar/null","title":"Null","description":"Null adalah representasi dari data kosong. Null digunakan untuk memberikan data kosong terhadap sebuah variable. Saat kita memberikan sebuah variable dengan nilai null, maka artinya variable tersebut tidak memiliki data atau nilai. Null di Java direpresentasikan dengan kata kunci null. Dan null hanya bisa diberikan kepada variable dengan tipe data object.","sidebar":"tutorialSidebar"},"dasar/operator-matematika":{"id":"dasar/operator-matematika","title":"Operator Matematika","description":"Java mendukung operasi banyak sekali operator matematika. Fitur operator matematika wajib dimiliki oleh semua bahasa pemrograman. Di artikel ini kita akan bahas secara lengkap operator matematika apa saja yang bisa dilakukan di Java.","sidebar":"tutorialSidebar"},"dasar/pengenalan-java":{"id":"dasar/pengenalan-java","title":"Pengenalan Java","description":"Java adalah bahasa pemrograman berorientasi objek yang sangat populer. Java merupakan salah satu bahasa pemrograman yang bisa digunakan untuk membuat aplikasi console, desktop, web sampai ke mobile.","sidebar":"tutorialSidebar"},"dasar/program-hello-world":{"id":"dasar/program-hello-world","title":"Program Hello World","description":"Saat belajar bahasa pemrograman, biasanya kita akan membuat sebuah program Hello World. Program Hello World adalah sebuah program sederhana yang hanya menampilkan tulisan Hello World. Dan pada tutorial ini, kita akan mencoba membuat program Hello World menggunakan Java","sidebar":"tutorialSidebar"},"dasar/tipe-data-array":{"id":"dasar/tipe-data-array","title":"Tipe Data Array","description":"Array atau dalam bahasa indonesia bernama Larik, adalah sebuah tipe data yang berisikan kumpulan tipe data yang sama. Hampir di semua bahasa pemrograman memiliki fitur Array. Tanpa Array, akan sulit menyimpan data dalam jumlah banyak, apalagi dalam variable, maka kita harus membuat banyak sekali variable.","sidebar":"tutorialSidebar"},"dasar/tipe-data-boolean":{"id":"dasar/tipe-data-boolean","title":"Tipe Data Boolean","description":"Boolean adalah tipe data tentang kebenaran, dimana terdapat dua nilai, benar dan salah. Di Java tipe data ini direpresentasikan dengan kata kunci boolean, dan untuk nilai benar direpresentasikan dengan kata kunci true, sedangkan untuk salah direpresentasikan dengan kata kunci false.","sidebar":"tutorialSidebar"},"dasar/tipe-data-bukan-primitif":{"id":"dasar/tipe-data-bukan-primitif","title":"Tipe Data Bukan Primitif","description":"Java adalah basa pemrograman yang berorientasi Objek. Namun sebenarnya secara garis besar, terdapat dua jenis tipe data di Java. Tipe data primitif dan tipe data Object (bukan primitif)","sidebar":"tutorialSidebar"},"dasar/tipe-data-character":{"id":"dasar/tipe-data-character","title":"Tipe Data Character","description":"Selain tipe data number, Java mendukung tipe data karakter (character). Ini adalah tipe data yang berisikan satu karakter (hurup, angka, dan simbol). Karakter di Java merupakan karakter 16-bit Unicode.","sidebar":"tutorialSidebar"},"dasar/tipe-data-number":{"id":"dasar/tipe-data-number","title":"Tipe Data Number","description":"Dalam pemrograman, ada banyak sekali tipe data. Salah satu yang paling sering kita gunakan adalah tipe data number atau angka. Data number banyak sekali kita gunakan dalam kehidupan sehari-hari, contohnya uang, jumlah, nilai ujian di sekolah, harga barang, dan lain-lain.","sidebar":"tutorialSidebar"},"dasar/tipe-data-string":{"id":"dasar/tipe-data-string","title":"Tipe Data String","description":"Tipe data string adalah tipe data yang berisikan kumpulan kosong atau lebih karakter. Sederhananya, string adalah tulisan atau text. Di Java, string direpresentasikan dengan kata kunci String. Dan untuk membuat data String, kita bisa menggunakan \\" (petik dua) lalu diikuti dengan isi string nya, dan diakhiri dengan \\" (petik dua) lagi.","sidebar":"tutorialSidebar"},"dasar/variable":{"id":"dasar/variable","title":"Variable","description":"Variable adalah tempat untuk menyimpan data. Saat membuat variable di Java, kita perlu menentukan tipe data yang ingin kita gunakan. Dan di Java, variable tidak bisa berubah tipe data setelah dibuat. Misal jika kita sudah membuat variable dengan tipe data String, tidak bisa berubah menjadi variable dengan tipe data int atau yang lainnya. Berikut adalah cara membuat variable di Java.","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Pendahuluan","description":"Belajar pemrograman Java untuk Pemula sampai Mahir","sidebar":"tutorialSidebar"}}}')}}]);